    false,nt"url": null,nt"notes": "This annual narrative report for Clarence
    Cannon NWR and Annada District outlines Refuge accomplishments during the 1990 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    management planning. Refuge administration is outlined; information about personnel,
    youth programs, funding, and safety is given. Habitat management is also covered;
    subjects include wetlands, croplands, fire management, pest control, and private
    lands. The wildlife section of the report discusses endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries
    resources, and animal control. The public uses of the Refuge described in this report
    include interpretive programs and law enforcement. The equipment and facilities
    section of the report provides information about rehabilitation, major maintenance,
    equipment replacement, communication systems, computer systems, and energy conservation.",nt"license_title":
